def load_model_from_string(s_model=S_MODEL):
    model_bytes = zlib.decompress(base64.b64decode(s_model))
    model = pickle.loads(model_bytes)
    return model

def load_model_pickle(path="model.sklearn"):
    file = open(path,'rb')
    model = pickle.load(file)
    file.close()
    return model
        
def when_machine_was_last(m_id, moves):
    steps_back = 0
    for i in range(len(moves)-1, 0, -1):
        if m_id == moves[i]:
            break      
        steps_back += 1
    return steps_back

def how_many_times_pull_same(m_id, moves):
    pulled_same = 0
    for i in range(len(moves)-1, 0, -1):
        if m_id == moves[i]:
            pulled_same += 1
        else:
            break    
    return pulled_same


class GreedyStrategy:
    """Implements strategy to maximize expected value

    - Tracks estimated likelihood of payout ratio for each machine
    - Tracks number of pulls on each machine
    - Chooses machine based on maximum expected value
    
    
    """
    def __init__(self, name, agent_num, n_machines):
        """Initialize and train decision tree model

        Args:
           name (str):   Name for the agent
           agent_num (int):   Assigned player number
           n_machines (int):   number of machines in the game
        
        """
        # Record inputs
        self.name = name
        self.agent_num = agent_num
        self.n_machines = n_machines
        
        # Initialize distributions for all machines
        self.n_pulls_self = np.array([0 for _ in range(n_machines)])
        self.n_success_self = np.array([0. for _ in range(n_machines)])
        self.n_pulls_opp = np.array([0 for _ in range(n_machines)])
        self.machines_last_outcome = np.array([0 for _ in range(n_machines)])

        # Track other players moves
        self.moves = []
        self.opp_moves = []
        self.success_moves = []
        
        #last
        self.last = -1
        self.opp_last = -1
        
        
        self.last_reward = 0
        
        # Track winnings
        self.last_reward_count = 0
        self.follow_oppo = False

        # Create model to predict expected reward
        if LOAD_FROM_STRING:
            self.model = load_model_from_string() 
        else:
            self.model = load_model_pickle()
        
        # Predict expected reward
        features = np.zeros((self.n_machines, COLUMN_COUNT))
        features[:, 0] = len(self.opp_moves)
        features[:, 1] = self.n_pulls_self
        features[:, 2] = self.n_success_self
        features[:, 3] = self.n_pulls_opp
        features[:, 4] = 0
        features[:, 5] = 0
        features[:, 6] = 0
        features[:, 7] = 0
        features[:, 8] = 0
        #features[:, 9] = 0
        #features[:, 10] = 0
        #features[:, 11] = 0
        features[:, 9] = len(set(self.moves + self.opp_moves))
        features[:, 10] = self.machines_last_outcome
        
        self.predicts = self.model.predict(features) if not isinstance(self.model, xgb.core.Booster) else self.model.predict(xgb.DMatrix(features))
        

