    def updateDist(self, curr_total_reward, last_m_indices):
        """Updates estimated distribution of payouts"""
        # Compute last reward
        self.last_reward = curr_total_reward - self.last_reward_count
        self.last_reward_count = curr_total_reward
        if VERBOSE:
            print('Last reward: %i' % self.last_reward)

        if len(last_m_indices) == 2:
            # Update number of pulls for both machines
            m_index = last_m_indices[self.agent_num]
            opp_index = last_m_indices[(self.agent_num + 1) % 2]
            self.n_pulls_self[m_index] += 1
            self.n_pulls_opp[opp_index] += 1
            
            # same and last update
            self.last = m_index
            self.opp_last = opp_index

            # Update number of successes
            self.n_success_self[m_index] += self.last_reward
            
            self.moves.append(m_index)
            #update success
            if self.last_reward:
                self.success_moves.append(m_index)
                if self.machines_last_outcome[m_index] > 0:
                    self.machines_last_outcome[m_index] +=1
                else:
                    self.machines_last_outcome[m_index] = 1
            else:
                if self.machines_last_outcome[m_index] < 0:
                    self.machines_last_outcome[m_index] -=1
                else:
                    self.machines_last_outcome[m_index] = -1 
                    
            # Update opponent activity
            self.opp_moves.append(opp_index)
            
            #['round_num', 'n_pulls_self', 'n_success_self', 'n_pulls_opp', 
            #   'pull_same_self', 'pull_same_opp', 'pulled_same_both', 
            #   'not_pulled_self', 'not_pulled_opp', 'reward_self', 'rewarded', 'not_rewarded']            
            features = np.zeros((self.n_machines, COLUMN_COUNT))
            features[:, 0] = len(self.opp_moves)
            features[:, 1] = self.n_pulls_self
            features[:, 2] = self.n_success_self
            features[:, 3] = self.n_pulls_opp
            features[:, 4] = 0
            features[:, 5] = 0
            #features[:, 6] = 0
            
            features[:, 8] = curr_total_reward
            #features[:, 10] = 0
            #features[:, 11] = 0
            features[:, 9] = len(set(self.moves + self.opp_moves))
            features[:, 10] = self.machines_last_outcome

            for i in range(self.n_machines):
                features[i, 6] = when_machine_was_last(i, self.moves)
                features[i, 7] = when_machine_was_last(i, self.opp_moves)
                #features[i, 10] = how_many_times_pull_same(i, self.success_moves)
                #features[i, 11] = when_machine_was_last(i, self.success_moves)
            
                    
            m_in_moves = how_many_times_pull_same(m_index, self.moves)
            m_in_moves_opp = how_many_times_pull_same(m_index, self.opp_moves)
            psb = min(m_in_moves, m_in_moves_opp) if m_index == opp_index else 0
            
            #features[m_index, 4] = m_in_moves #same
            features[m_index, 4] = m_in_moves_opp
            features[m_index, 5] = psb
            if m_index != opp_index:    
                # 4 and 6 is 0 so do not have to set
                features[opp_index, 4] = how_many_times_pull_same(opp_index, self.opp_moves) 
            
            
                
            self.predicts = self.model.predict(features) if not isinstance(self.model, xgb.core.Booster) else self.model.predict(xgb.DMatrix(features))
            

