def agent(observation, configuration):
    global curr_agent
    global total_reward, bandit_dict
    my_last_action = None
    my_pull = random.randrange(configuration['banditCount'])
    if 0 == observation['step']:
        total_reward = 0
        bandit_dict = {}
        for i in range(configuration['banditCount']):
            bandit_dict[i] = {'win': 1, 'loss': 0, 'opp': 0, 'my_continue': 0,
                              'op_continue': 0, 'not_pull_since_last_0': 0,
                              'not_pull_since_last_1': 0}

    else:
        last_reward = observation['reward'] - total_reward
        total_reward = observation['reward']

        my_idx = observation['agentIndex']
        my_last_action = observation['lastActions'][my_idx]
        op_last_action = observation['lastActions'][1 - my_idx]

        my_action_list.append(my_last_action)
        op_action_list.append(op_last_action)

        for ii in range(configuration['banditCount']):
            if ii != my_last_action:
                bandit_dict[ii]['not_pull_since_last_0'] += 1
            else:
                bandit_dict[ii]['not_pull_since_last_0'] = 0
            if ii != op_last_action:
                bandit_dict[ii]['not_pull_since_last_1'] += 1
            else:
                bandit_dict[ii]['not_pull_since_last_1'] = 0

        if 0 < last_reward:
            bandit_dict[my_last_action]['win'] = bandit_dict[my_last_action][
                                                     'win'] + 1
        else:
            bandit_dict[my_last_action]['loss'] = bandit_dict[my_last_action][
                                                      'loss'] + 1
        bandit_dict[op_last_action]['opp'] = bandit_dict[op_last_action][
                                                 'opp'] + 1

        if observation['step'] >= 3:
            if my_action_list[-1] == my_action_list[-2]:
                bandit_dict[my_last_action]['my_continue'] += 1
            else:
                bandit_dict[my_last_action]['my_continue'] = 0
            if op_action_list[-1] == op_action_list[-2]:
                bandit_dict[op_last_action]['op_continue'] += 1
            else:
                bandit_dict[op_last_action]['op_continue'] = 0
    
    if observation.step == 0:
        # Initialize agent
        curr_agent = GreedyStrategy(
            'Mr. Agent %i' % observation['agentIndex'],
            observation['agentIndex'],
            configuration['banditCount'])
    
    # Update payout ratio distribution with:
    curr_agent.updateDist(observation['reward'], observation['lastActions'])

    if observation.step > 0:
        decay_ratio = 1
        if bandit_dict[my_last_action]['my_continue'] > 1:
            decay_times = int(bandit_dict[my_last_action]['my_continue'])
            decay_ratio = np.power(0.97, decay_times)
    if my_last_action:
        return curr_agent(
            observation['reward'],
            my_last_action,
            op_last_action,
            bandit_dict[my_last_action]['my_continue'],
            bandit_dict[op_last_action]['op_continue'],
            decay_ratio
        )
    elif my_last_action == 0:
        return curr_agent(
            observation['reward'],
            my_last_action,
            op_last_action,
            bandit_dict[my_last_action]['my_continue'],
            bandit_dict[op_last_action]['op_continue'],
            decay_ratio
        )
    else:
        return curr_agent(observation['reward'], 0, 0, 0, 0, 1)
